_f5._n5[3]="Vodík objevil roku 1766 Angličan Henry Cavendish, když si všiml, že při rozpouštění neušlechtilých kovů v kyselině vzniká bezbarvý, hořlavý plyn. V roce 1781 poznal také jako první, že voda je sloučeninou kyslíku a vodíku.";_f5._n5[4]="Elementární vodík je na Zemi přítomen jen vzácně, nejvíce elementárního vodíku se vyskytuje v blízkosti sopek v sopečných plynech. Plynný vodík se v našem prostředí vyskytuje ve formě dvouatomových molekul H2, je však známo, že v mezihvězdném prostoru je přítomen z převážné části jako atomární vodík H. V zemské atmosféře se vyskytuje jen ve vyšších vrstvách a díky své mimořádně nízké hmotnosti postupně z atmosféry vyprchává. Elementární vodík je však jednou z podstatných složek zemního plynu, vyskytuje se i v ložiscích uhlí.";
